package com.k.blog.entity;import com.k.blog.enums.UserAction;import java.io.Serializable;/** * @author kangkai on 2018/4/23. */public class Log implements Serializable {    private static final long serialVersionUID = 1L;    private Long id;    private UserAction action;    private String data;    private Long authorId;    private String ip;    private Long created;    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public UserAction getAction() {        return action;    }    public void setAction(UserAction action) {        this.action = action;    }    public String getData() {        return data;    }    public void setData(String data) {        this.data = data;    }    public Long getAuthorId() {        return authorId;    }    public void setAuthorId(Long authorId) {        this.authorId = authorId;    }    public String getIp() {        return ip;    }    public void setIp(String ip) {        this.ip = ip;    }    public Long getCreated() {        return created;    }    public void setCreated(Long created) {        this.created = created;    }    @Override    public String toString() {        return "Log{" +                "id=" + id +                ", action='" + action + '\'' +                ", data='" + data + '\'' +                ", authorId=" + authorId +                ", ip='" + ip + '\'' +                ", created=" + created +                '}';    }}